/** @jsxImportSource @emotion/react */
import { css } from "@emotion/react";
import { Cell, Grid, VFlow } from "bold-ui";
import React from "react";
import { Header } from "../components/Header";
import { PageContainer } from "../components/PageContainer";

interface ListUsersViewProps {
  num?: number;
  perfil?: boolean;
}

export function ListUsersView(props: ListUsersViewProps) {
  const { num, perfil } = props;

  return (
    <VFlow>
      <Header title="Usuários"></Header>
      <PageContainer>
        <Grid gap={2} gapVertical={1} justifyContent="flex-start">
          <Cell lg={8} md={8} sm={8} xs={12}></Cell>
        </Grid>
      </PageContainer>
    </VFlow>
  );
}
const buttonStyles = css`
  width: 100%;
`;
